main:

# Cor do contorno
ori $9, $0, 0x00ceb695
 
# --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------


# Desenha o contorno superior e inferior do quadro
lui $8, 0x1001 # Contorno superior
lui $12, 0x1001 # Contorno inferior
addi $10, $0, 256
add $11, $0, $0

addi $12, $12, 31744

loop_contorno_superior_inferior:

beq $10, $11, desenhar_contorno_lateral

sw $9, 0($8) # Carrega a cor no endereço atual de $8
sw $9, 0($12) # Carrega a cor no endereço atual de $12

addi $8, $8, 4
addi $12, $12, 4
addi $11, $11, 1
j loop_contorno_superior_inferior

# --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------


# Desenha o contorno lateral do quadro
desenhar_contorno_lateral:

lui $8, 0x1001 # Contorno lateral esquerdo
lui $12, 0x1001 # Contorno lateral direito
addi $10, $0, 120
add $11, $0, $0

addi $8, $8, 1024 # $8 posicionado na primeira coluna da 3 linha
addi $12, $12, 1528 # $12 posicionado na penultima coluna da 3 linha

addi $15, $0, 2 # Limite interno para o desenho das colunas
add $14, $0, $0 # Contador das colunas do contorno lateral

loop_contorno_lateral:
beq $10, $11, desenha_fundo_quadro

addi $14, $14, 1

sw $9, 0($8) # Carrega a cor no endereço atual de $8
sw $9, 0($12) # Carrega a cor no endereço atual de $12

addi $8, $8, 4
addi $12, $12, 4


addi $11, $11, 1

beq $15, $14, pula_linha_lateral

j loop_contorno_lateral

pula_linha_lateral:

add $14, $0, $0 # zera o contador de colunas
addi $8, $8, 504 # Pula para o inicio da proxima linha
addi $12, $12, 504 # Pula para a penultima coluna da proxima linha
j loop_contorno_lateral

# --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
desenha_fundo_quadro:

# Desenha o fundo do quadro
ori $9, $0, 0x00e3729 # cor de fundo do quadro

# --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------



lui $8, 0x1001 # fundo do quadro
addi $10, $0, 7440
add $11, $0, $0

addi $8, $8, 1032 # $8 posicionado na terceira coluna da 3 linha
addi $15, $0, 124 # Limite interno para o desenho das colunas
add $14, $0, $0 # Contador das colunas do fundo do quadro

loop_quadro:

beq $10, $11, Titulo_Inicial

addi $14, $14, 1
sw $9, 0($8) # Carrega a cor no endereço atual de $8
addi $8, $8, 4
addi $11, $11, 1

beq $15, $14, pula_linha_quadro

j loop_quadro

pula_linha_quadro:

add $14, $0, $0 # zera o contador de colunas
addi $8, $8, 16 # Pula para o inicio da proxima linha

j loop_quadro
# --------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------

