bot_ou_jogador:

lui  $13, 0xffff
lw   $16, 0($13)
beq  $16, $0, bot_ou_jogador  # espera tecla
lw   $17, 4($13)
addi $18, $0, '1'
beq  $17, $18, JxJ

# Se apertou '2' -> Bot
addi $18, $0, '2'
beq  $17, $18, JxB

j    bot_ou_jogador  # tecla inválida, repete

JxJ:
    la   $8, modo_de_jogo
    sw   $0, 0($8)        # salva 0
    j    sorteiooo

JxB:
    la   $8, modo_de_jogo
    addi $9, $0, 1
    sw   $9, 0($8)        # salva 1
    j    sorteiooo


